import React, { useState, useEffect } from "react";
import axios from "axios";
import { ArrowDown, ArrowUp } from "../../common/icons/icons";
import { Link, NavLink } from "react-router-dom";
import { useSelector } from "react-redux";

const ContractEmployeeMain = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    getUsers();
  }, []);

  const getUsers = async () => {
    const response = await axios.get("http://localhost:5000/users");
    setUsers(response.data);
  };

  return (
    <div>
      {users.length > 0 ? (
        <div className="div-table">
          <div className="div-table-options">
            <NavLink className="table-options" to="/adduser">
              Dodaj u≈ºytkownika
            </NavLink>
          </div>
          <table className="employee-table">
            <thead>
              <tr className="employee-tr">
                <th>Stanowisko</th>
                <th>Start Kontraktu</th>
                <th>Koniec Kontraktu</th>
                <th>Rodzaj Kontraktu</th>
                <th className="employee-setting">Opcje</th>
              </tr>
            </thead>
            <tbody>
              {users.map((user, index) => (
                <React.Fragment key={user.uuid}>
                {user.profile && user.profile.contracts.length > 1 && (


                    user.profile.contracts.map((contract) => (
                    <tr key={contract.id}>
                        <td> {contract.position}</td>
                        <td>{contract.startContract}</td>
                        <td> {contract.endContract}</td>
                        <td>{contract.typeContract}</td>
                        <hr />
                    </tr>
                    ))
                    )}
                </React.Fragment>
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <div>Loading...</div>
      )}
    </div>
  );
};

export default ContractEmployeeMain;
